import { useState } from "react";


const initState = {
    eamil: 'thistrik@naver.com',
    pw: '1111'
}

const LoginComponent = () => {

    const [loginInfo, setLoginInfo] = useState({...initState})

    return ( 
        <div>
            <div>
                <label>Email</label>
                <input type="text" name="email" value={loginInfo.eamil}></input>
            </div>
            <div>
                <label>Password</label>
                <input type="password" name="pw" value={loginInfo.pw}></input>
            </div>
            <div>
                <button>LOGIN</button>
            </div>
        </div>
     );
}

export default LoginComponent;
